const targetMaterials = ['aluminium', 'gold', 'polypropylene', 'plastic'];
const thicknesses = [5.0, 4.0, 10.0, 0.544, 0.266];
const pulseWidths = [3000, 7600, 500, 30, 30];
const energies = [500.0, 37.827, 164.43, 2.373, 2.342];
const spotSizes = [60.0, 2.552, 4.746, 3.3, 3.3];
const intensities = [4.088E+18, 6.750E+19, 1.289E+21, 6.413E+20, 6.329E+20];
const powers = [166700000000000, 49770000000000, 328900000000000, 79090000000000, 78050000000000];
const cutoffEnergies = [8.64, 4.8, 6.23e13, 4.0, 4.0];

let syntheticData = [];

for (let i = 0; i < 25; i++) {
  const randomMaterialIndex = Math.floor(Math.random() * targetMaterials.length);
  const randomThickness = Math.floor(Math.random() * thicknesses.length) + 1;
  const randomPulseWidth = Math.floor(Math.random() * pulseWidths.length) + 1;
  const randomEnergy = Math.floor(Math.random() * energies.length) + 1;
  const randomSpotSize = Math.floor(Math.random() * spotSizes.length) + 1;
  const randomIntensity = Math.floor(Math.random() * intensities.length) + 1;
  const randomPower = Math.floor(Math.random() * powers.length) + 1;
  const randomCutoffEnergy = Math.floor(Math.random() * cutoffEnergies.length) + 1;

  syntheticData.push({
    target_material: targetMaterials[randomMaterialIndex],
    target_thickness: thicknesses[randomThickness],
    pulse_width: pulseWidths[randomPulseWidth],
    energy: energies[randomEnergy],
    spot_size: spotSizes[randomSpotSize],
    intensity: intensities[randomIntensity],
    power: powers[randomPower],
    cutoff_energy: cutoffEnergies[randomCutoffEnergy],
  });
}

console.log(syntheticData);

